const Base64 = require('js-base64').Base64
export default {
  name: 'externalLink',
  data() {
    return {
      url: ''
    }
  },
  created() {
    const urlAddress = this.$route.meta.urlAddress || ''
    if (urlAddress) return this.url = urlAddress
    const href = Base64.decode(this.$route.query.href)
    this.url = href || ''
  },
  methods: {}
}
